import React from 'react';


function CodingChallenges() {

  return (
    <div>
      <h2>Coding Challenges</h2>
      <p>I like to challenge myself and learn new things. Coding challenges allow me to solve new problems with code but on a smaller scale that a full project</p>
    </div>

  );
}

export default CodingChallenges;
